import { React, useState } from "react";

const Products = () => {
  const [category, setCategory] = useState([
    {
      id: 1,
      name: "kursi",
    },
    {
      id: 2,
      name: "meja",
    },
    {
      id: 3,
      name: "lemari",
    },
  ]);
  return (
    <div className="container">
      <table className="table">
        <thead>
          <tr>
            <th scope="col">No</th>
            <th scope="col">Name</th>
          </tr>
        </thead>
        <tbody>
          {category.map((item, index) => (
            <tr key={index}>
              <td>{item.id}</td>
              <td>{item.name}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Products;
